import React from 'react'

const Solver = () => {
    let board = [];
    return (
        <>
            <Board>
                {board.map((num) => (
                    <Cell>num</Cell>
                ))}
            </Board>
            <SolveBtn>Solve</SolveBtn>
        </>
    )
}

export default Solver
